import React from "react";
// import { Link } from "react-router-dom";

const SideBar = () => {
  return (
    <div>
      <div className="fixed z-50 flex w-16 h-screen overflow-hidden bg-white">
        <div className="absolute w-fit h-fit"></div>
      </div>
    </div>
  );
};

export default SideBar;
